import React, { Component } from 'react';

class Email extends Component{

  render(){
    return (
      <div className="animated fadeIn">
        <div className="ubuntu-app " style={{border:0, marginTop:20}}>
            <main>
                Email
            </main>
        </div>
      </div>
    )
  }
}

export default Email;
